('2348','23','6103','Schulz',Null,'7 Ferienapartments mit Pool an der Ostküste Mallorcas zu verkaufen','33083','Nur 500m vom Strand und einem idyllischen Hafenstädtchen entfernt, steht diese sehr gepflegte Ferien. Apartmentanlage in Finca Stil. Die Anlage wird mit einer VTV Lizenz (Viviendas-Turisticas-Vacacionales)  betrieben. Es stehen 7 Apartments zur Verfügung, die sich wie folgt aufteilen:  4 Reihenbungalows ,a 49 qm,  mit einem Doppelzimmer und zwei Schlafcouches im Wohnraum, Küche, Wohnraum, Bad mit Dusche, Terrasse zum Pool/Garten.    Turmappartement, 79 qm, Erdgeschoss mit zwei Doppelzimmern, Küche, Wohnraum, Bad mit Dusche, Terrasse zum Pool/Garten.    Turmappartement, 79 qm, 1. Etage mit zwei Doppelzimmern, Küche, Wohnraum, zwei Bäder mit Dusche, Balkon (ca. 40 qm) zum Pool/Garten.    Reiheneckhaus, ca. 119 qm, doppelgeschossig mit drei Doppelzimmern (klimatisiert), Küche, Wohnzimmer, zwei Bäder mit Dusche, Balkone und Terrassen zum Pool/Garten.  Im Außenbereich hat es einen großzügig angelegten Poolbereich für die Gäste. Top gepflegte Anlage!\r\n\r\n','33084','1200000','106','2015-07-03 12:06:30','106','2015-07-03 12:07:53',Null,'2422','105','1139',1,'1','0',Null,Null,'Preis auf Anfrage','33085',Null,'0','0','0',Null,'2015-07-03 12:14:46',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33086',Null,'33087',Null,'33088',Null,'33089',Null,'33090','0',0,'4');
